import { Row, Col, Form, Button } from 'react-bootstrap';
import { connect } from 'react-redux';
import { useState } from 'react';
import { useHistory } from 'react-router-dom';
import pick from 'lodash/pick';
import store from '../store';
import { create_user, fetch_users, fetch_user, api_login, fetch_reason } from '../api';

function UsersView() {
  let history = useHistory();

  function Register({session}) {
        return(
        <Row>
          <Col>
            <h1 className="mt-3">My Profile</h1>
            <h3>Name: {session.name}</h3>
            <h3>Email: {session.email}</h3>
            <h3>Reason: {session.reason}</h3>
          </Col>
        </Row>
      )
  }

  const LoginInRegister = connect(
    ({session}) => ({session}))(Register);

  return (
    <div>
      <LoginInRegister />
    </div>
  );
}

function state2props(_state) {
  return {};
}

export default connect(state2props)(UsersView);
